import React from 'react';
import './Login.css';
export default function Login() {
    return (
        <div className='login-wrapper'>
            <img className="signin--header" src="https://tix.vn/app/assets/img/login/group@2x.png" />
            <form>
                <h3 className='text-white font-bold text-2xl'>LOGIN</h3>
                <input placeholder="Name" className="border-2 transition duration-500 placeholder-red-400 focus:placeholder-transparent border-red-400 w-4/12 py-2 text-center text-red-400 bg-transparent rounded-md focus:outline-none w-full" />

            </form>
            <div className="signin--message">Đăng nhập để được nhiều ưu đãi, mua vé<br />và bảo mật thông tin!</div>


            <div className="signin-close" />

        </div>


    );
}
